import React, { Component } from "react";
import StudentNavMenu from "./StudentNavMenu";
import { Accordion, Card } from "react-bootstrap";
import PersonalInformation from "./PersonalInformation";
import ImmediateNeeds from "./ImmediateNeeds";
import PropTypes from "prop-types";
import { connect } from "react-redux";

class Student extends Component {
  constructor(props) {
    super(props);
    this.toggleStudentFormCard = this.toggleStudentFormCard.bind(this);
  }

  toggleStudentFormCard() {}

  render() {
    const { activeStudentSection } = this.props.student;

    return (
      <div className="student-container">
        <StudentNavMenu
          onClickHandler={this.toggleStudentFormCard}
        ></StudentNavMenu>
        <div className="student-form-container ml-auto">
          <Accordion
            defaultActiveKey={this.props.student.activeStudentSection}
            className="sfc-accordion"
          >
            <Card className="sfc-container">
              <Accordion.Collapse eventKey={0}>
                <PersonalInformation componentName="Personal Information"></PersonalInformation>
              </Accordion.Collapse>
            </Card>
          </Accordion>
          <Accordion>
            <Card className="sfc-container">
              <Accordion.Collapse eventKey={2}>
                <ImmediateNeeds></ImmediateNeeds>
              </Accordion.Collapse>
            </Card>
          </Accordion>
        </div>
      </div>
    );
  }
}

Student.propTypes = {
  student: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  student: state.student,
});

export default connect(mapStateToProps)(Student);
